import React, { useState, useEffect, useRef } from 'react';
import { Volume2 } from 'lucide-react';

const API_URL = 'http://localhost:5000/api';

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const messagesEndRef = useRef(null);

  useEffect(() => {
    addBotMessage("Hello! I'm your Darija Medical Terms assistant. How can I help you today?");
  }, []);

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const addBotMessage = (text, terms = null) => {
    setMessages(prevMessages => [...prevMessages, { text, isBot: true, terms }]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (input.trim() === '') return;

    setMessages(prevMessages => [...prevMessages, { text: input, isBot: false }]);
    setInput('');

    try {
      const response = await fetch(`${API_URL}/terms/search`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ query: input }),
      });
      const data = await response.json();

      if (data.terms) {
        addBotMessage("Here's what I found:", data.terms);
      } else {
        addBotMessage(data.message);
      }
    } catch (error) {
      console.error('Error processing query:', error);
      addBotMessage("I'm sorry, I'm having trouble processing your request. Please try again later.");
    }
  };

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  const speak = (text, lang) => {
    if ('speechSynthesis' in window) {
      const utterance = new SpeechSynthesisUtterance(text);
      utterance.lang = lang;
      window.speechSynthesis.speak(utterance);
    } else {
      console.error('Text-to-speech not supported in this browser');
    }
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Darija Medical Terms Chatbot</h1>
      <div className="h-[60vh] overflow-auto p-4 mb-4 border rounded">
        {messages.map((message, index) => (
          <div key={index} className={`mb-4 ${message.isBot ? 'text-left' : 'text-right'}`}>
            <div className={`inline-block p-2 rounded ${message.isBot ? 'bg-gray-200' : 'bg-blue-200'}`}>
              <p>{message.text}</p>
              {message.terms && (
                <div className="mt-2">
                  {message.terms.map((term, termIndex) => (
                    <div key={termIndex} className="border p-2 rounded mb-2">
                      <h3 className="font-bold">{term.darija}</h3>
                      <p>English: {term.english}</p>
                      <p>French: {term.french}</p>
                      <p>Spanish: {term.spanish}</p>
                      <p>Dutch: {term.dutch}</p>
                      <p>Category: {term.category}</p>
                      <div className="mt-2">
                        <button onClick={() => speak(term.darija, 'ar-MA')} className="mr-2 p-1 bg-gray-300 rounded">
                          <Volume2 size={16} /> Darija
                        </button>
                        <button onClick={() => speak(term.english, 'en-US')} className="p-1 bg-gray-300 rounded">
                          <Volume2 size={16} /> English
                        </button>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        ))}
        <div ref={messagesEndRef} />
      </div>
      <form onSubmit={handleSubmit} className="flex">
        <input
          type="text"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          placeholder="Type your message here..."
          className="flex-grow mr-2 p-2 border rounded"
        />
        <button type="submit" className="px-4 py-2 bg-blue-500 text-white rounded">
          Send
        </button>
      </form>
    </div>
  );
}

export default App;
